column5:
Criação de uma política pública de fomento específica para a juventude da agricultura familiar, camponesa, assalariada rural, para os povos e comunidades tradicionais (os reconhecidos e os que lutam pelo reconhecimento), que respeite os seguintes princípios:
(a) priorização, associativismo e cooperativismo;
(b) valorização de práticas agroecológicas alternativas;
(c) priorização da participação dos jovens dos movimentos sociais e do campo na elaboração e monitoramento das politicas públicas.
